  /*
   * Ergodic Balanced Indicator Sets
   *
   * The Balanced Indicator Set of length N is the set of all length N binary
   * strings, such that each contains an equal number of 1s and 0s (note that,
   * necessarily, N must be even).
   *
   * A subset of the Balanced Indicator Set of length N is called "ergodic"
   * if it contains an equal number of 1s and 0s in each bit position among
   * all elements.
   *
   * Generating Ergodic Balanced Indicator Sets can be accomplished in
   * different ways (simply taking an arbitrary subset of a Balanced
   * Indicator Set will not work, as not all of them are ergodic), but it
   * basically boils down to:
   *
   * 1. identify operations "op" on a bit string S such that:
   *    a. if S is balanced, then so is op(S), and
   *    b. the set { S, op(S) } is ergodic
   *    this operation should induce an equivalence relation on all the
   *    balanced bit sets of length N,
   * 2. enumerate all N bit bit strings in some order,
   * 3. if the bit string under consideration is balanced, add it to the
   *    resulting set, along with all the op(S) ones,
   * 4. if you have enough bit strings, stop, if the added bit strings would
   *    add too many to the resulting set, simply ignore them and keep on
   *    enumerating
   *
   * Examples of possible operations include:
   *
   * - inverting every bit in the bit string (ie. op = not): this operation
   *     clearly satisfies conditions (a) and (b) above,
   * - reversing the order of the bits in the bit string (ie. op = rev): this
   *     operation, again, clearly satisfies conditions (a) and (b) above,
   * - rotating the bit string by different amounts (ie. op = rotM): this
   *     operation clearly satisfies condition (a) above, to see that it
   *     satisfies (b), simply observe that all the bits are eventually counted
   *     for weighing a position's count of 1s and 0s.
   *
   * One can take a single one of these operations, or all of them at once.
   *
   * Sometimes, a specific cardinality cannot be attained for an ergodit set,
   * eg. an odd cardinality for N a power of 2. This is because the operations
   * above always yield a set of even cardinality.
   *
   *
   * The following is a list of 8192 Ergodic Balanced Indicators out of the
   * 12870 of length 16; it was generated with the procedure outlined above,
   * using all the operations mentioned above, the set was then ordered and
   * laid out as is seen here.
   *
   */

